// import logo from './logo.svg';
import './App.css';
import {useState} from 'react'

const articleList = [
  // html
  { title: 'HTML', body: 'HTML is Hyper-Text Markup Language'},

  // css
  { title: 'CSS', body: 'CSS defines the style of page' },

  // js
  { title: 'JS', body: 'Javascript defines the action of page' }
];

function HeaderTag() {
  return (
    <header>
      <h1>React Sample Page</h1>
    </header>
  )
}

function Nav() {
  return (
    <nav>
      <ol>
        <li><a href='#'>html</a></li>
        <li><a href='#'>css</a></li>
        <li><a href='#'>js</a></li>
      </ol>
    </nav>
  )
}

function Article(props) {
  return (
  <article>
    <h2>{props.title}</h2>
    {props.body}
  </article>)
}


function App() {
  const [id, setId] = useState()
  return (
    <>
    <HeaderTag />
    <Nav />
    <Article postId={id}/>
    </>
    );
}

export default App;
